(1130,	'de',	NULL,	NULL),
(1130,	'en',	'Classic Expo Salzburg',	'<p><strong>\"<span style=\"color:#333333; font-family:Roboto,sans-serif; font-size:15px\">The vintage era in the automotive world was a time of transition</span>.\"</strong><br />\n<span style=\"color:#333333; font-family:Roboto, sans-serif\"><span style=\"font-size:15px\">The car started off in 1919 as still something of a rarity, and ended up, in 1930, well on the way towards ubiquity. In fact, automobile production at the end of this period was not matched again until the 1950s. In the intervening years, most industrialized countries built nationwide road systems with the result that, towards the end of the period, the ability to negotiate unpaved roads was no longer a prime consideration of automotive design.</span></span></p>\n'),
(1130,	'fr',	NULL,	NULL),
(1131,	'de',	NULL,	NULL),
(1131,	'en',	'Auto Messe Salzburg \'19',	'<p><strong>\"International vintage car&nbsp;fair.\"</strong></p>\n\n<p><span style=\"color:#333333; font-family:Roboto, sans-serif\"><span style=\"font-size:15px\">A vintage car is, in the most general sense, an old automobile, and in the narrower senses of car enthusiasts and collectors, it is a car from the period of 1919 to 1930. Such enthusiasts have categorization schemes for ages of cars that enforce distinctions between antique cars, vintage cars, classic cars, and so on. The classification criteria vary, but consensus within any country is often maintained by major car clubs, for example the Vintage Sports-Car Club (VSCC) in the UK.</span></span></p>\n'),
(1131,	'fr',	NULL,	NULL),
(1132,	'de',	NULL,	NULL),
