(1133,	'de',	NULL,	NULL),
(1133,	'en',	'Vienna Auto Show',	'<p><strong style=\"color:#333333; font-family:Roboto,sans-serif; font-size:15px; font-weight:700\">\"International Automobiles, Spare Parts and Accessories Industry trade fair.\"</strong><br style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 15px;\" />\n<span style=\"color:#333333; font-family:Roboto,sans-serif; font-size:15px\">Vienna Auto Show, This event showcases product like Design, performance, efficiency in a production of the special class. Attendees will be delighted with new car models of many automobile brands, the Concept &amp; Show Cars, the Austria and European premieres.</span></p>\n'),
